import React from "react";
import Dice from 'react-dice-roll';
import "./s.css";

export default function App() {
  return (
    <div className="App">
      <h1>Hello CodeSandbox</h1>
      <Dice onRoll={(value) => console.log(value)} />
      <h2>Start editing to see some magic happen!</h2>
    </div>
  );
}
